import React from "react";
import {Trash2} from 'lucide-react';

export const TableComponent = () => {
  const data = [
    { id: 1, name: 'John Doe', age: 30, location: 'New York' },
    { id: 2, name: 'Jane Doe', age: 25, location: 'Los Angeles' },
    { id: 3, name: 'Gary Smith', age: 28, location: 'Chicago' },
    // Add more data as needed
  ];

  return (
    <div className="overflow-x-auto relative shadow-md sm:rounded-lg">
      <table className="w-full text-sm text-left text-gray-500 dark:text-gray-400">
        <thead className="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
          <tr>
            <th scope="col" className="py-3 px-6">
              Name
            </th>
            <th scope="col" className="py-3 px-6">
              Age
            </th>
            <th scope="col" className="py-3 px-6">
              Location
            </th>
            <th scope="col" className="py-3 px-6">
              Actions
            </th>
          </tr>
        </thead>
        <tbody>
          {data.map((row) => (
            <tr key={row.id} className="border-b dark:bg-gray-800 dark:border-gray-700 odd:bg-white even:bg-gray-50 odd:dark:bg-gray-800 even:dark:bg-gray-700">
              <td className="py-4 px-6">
                {row.name}
              </td>
              <td className="py-4 px-6">
                {row.age}
              </td>
              <td className="py-4 px-6">
                {row.location}
              </td>
              <td className="py-4 px-6 text-right">
                <button className="font-medium text-blue-600 dark:text-blue-500 hover:underline">
                  <Trash2 className="w-5 h-5"/>
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
